import {
        BrowserRouter as Router,
        Route,Switch,Link,Redirect
        } from "react-router-dom";

function Nav() {
  return (
 <Router>
    <div className="Nav">

       <ul >

           <li id="menu_nav"><Link to='/Habilidades'> HABILIDADES </Link></li>

       </ul>

    </div>
    <Switch>
     <Route exact path="/Habilidades" component={Skills} />
    </Switch>

</Router>



    );
}
export default Nav;
